This tutorial expects you to have followed the RMC installation instructions first. RMC is unlike the testing tools you may already be familiar with. Much of testing is concerned with thinking of new corner cases that need to be covered. With RMC, all the corner cases are covered from the start, and the new concern is narrowing down the scope to something manageable for the checker. Consider this first program (which can be found under rmc-docs/src/tutorial/rmc-first-steps ): fn estimate_size(x: u32) -> u32 { if x < 256 { if x < 128 { return 1; } else { return 3; } } else if x < 1024 { if x > 1022 { panic!("Oh no, a failing corner case!"); } else { return 5; } } else { if x < 2048 { return 7; } else { return 9; } }
} Think about the test harness you would need to write to test this function. You would need figure out a whole set of arguments to call the function with that would exercise each branch. You would need to keep that test harness up-to-date with the code, in case some of the branches change. And if this function was more complicated—for example, if some of the branches depended on global state—the test harness would be even more onerous to write. We can try to property test a function like this, but if we're naive about it (and consider all possible u32 inputs), then it's unlikely we'll ever find the bug. proptest! { #![proptest_config(ProptestConfig::with_cases(10000))] #[test] fn doesnt_crash(x: u32) { estimate_size(x); } } # cargo test
[...]
test tests::doesnt_crash ... ok There's only 1 in 4 billion inputs that fail, so it's vanishingly unlikely the property test will find it, even with a million samples. With RMC, however: #[cfg(rmc)]
#[no_mangle]
fn main() { let x: u32 = rmc::any(); estimate_size(x);
} # cargo rmc
[...]
Runtime decision procedure: 0.00116886s ** Results:
./src/lib.rs function estimate_size
[estimate_size.assertion.1] line 9 Oh no, a failing corner case!: FAILURE ** 1 of 1 failed (2 iterations)
VERIFICATION FAILED RMC has immediately found a failure. Notably, we haven't had to write explicit assertions in our "proof harness": by default, RMC will find a host of erroneous conditions which include a reachable call to panic or a failing assert.

17.body:
By default, RMC only reports failures, not how the failure happened. This is because, in its full generality, understanding how a failure happened requires exploring a full (potentially large) execution trace. Here, we've just got some nondeterministic inputs up front, but that's something of a special case that has a "simpler" explanation (just the choice of nondeterministic input). To see traces, run: rmc --visualize src/lib.rs
open report/html/index.html The first command runs RMC and generates the html-based report in report/. The second command opens that report in your default browser (on mac, on linux desktops try xdg-open). From this report, we can find the trace of the failure and filter through it to find the relevant line (at present time, an unfortunate amount of generated code is present in the trace): let x: u32 = rmc::any();
x = 1023u Here we're seeing the line of code and the value assigned in this particular trace. Like property testing, this is just one example of a failure. To find more, we'd presumably fix this issue and then re-run RMC.

