Rust is safe by default, and so includes dynamic (run-time) bounds checking where needed. Consider this Rust code (which can be found under rmc-docs/src/tutorial/kinds-of-failure ): /// Wrap "too-large" indexes back into a valid range for the array
fn get_wrapped(i: usize, a: &[u32]) -> u32 { if a.len() == 0 { return 0; } return a[i % a.len() + 1];
} We can again write a simple property test against this code: proptest! { #[test] fn doesnt_crash(i: usize, a: Vec<u32>) { get_wrapped(i, &a); } } This property test will immediately find the failing case because of this dynamic check. But what if we change this function to use unsafe Rust: return unsafe { *a.get_unchecked(i % a.len() + 1) }; Now the error becomes invisible to this test: # cargo test
[...]
test tests::doesnt_crash ... ok But we're able to check this unsafe code with RMC: #[cfg(rmc)]
#[no_mangle]
fn main() { let size: usize = rmc::any(); rmc::assume(size < 4096); let index: usize = rmc::any(); let array: Vec<u32> = vec![0; size]; get_wrapped(index, &array);
} # rmc tests/bounds-check.rs
[...]
** 1 of 468 failed (2 iterations)
VERIFICATION FAILED Notice there were a lot of verification conditions being checked: in the above output, 468! (It may change for you.) This is a result of using the standard library Vec implementation, which means our harness actually used quite a bit of code, short as it looks. RMC is inserting a lot more checks than appear as asserts in our code, so the output can be large. Let's narrow that output down a bit: # rmc tests/bounds-check.rs | grep FAIL
[get_wrapped.pointer_dereference.5] line 10 dereference failure: pointer outside object bounds in *var_5: FAILURE
VERIFICATION FAILED Notice that, for RMC, this has gone from a simple bounds-checking problem to a pointer-checking problem. RMC will check operations on pointers to ensure they're not potentially invalid memory accesses. Any unsafe code that manipulates pointers will, as we see here, raise failures if its behavior is actually unsafe. Consider trying a few more small exercises with this example: Exercise: Switch back to the normal/safe indexing operation and re-try RMC. What changes compared to the unsafe operation and why? (Try predicting the answer, then seeing if you got it right.) Exercise: Remember how to get a trace from RMC? Find out what inputs it failed on. Exercise: Fix the error, run RMC, and see a successful verification. Exercise: Try switching back to the unsafe code (now with the error fixed) and re-run RMC. It should still successfully verify. Click to see explanation for exercise 1 Having switched back to the safe indexing operation, RMC reports two failures instead of just one: # rmc tests/bounds-check.rs | grep FAIL
[get_wrapped.assertion.3] line 9 index out of bounds: the length is move _12 but the index is _5: FAILURE
[get_wrapped.pointer_dereference.5] line 9 dereference failure: pointer outside object bounds in a.data[var_5]: FAILURE
VERIFICATION FAILED The first is Rust's implicit assertion for the safe indexing operation. The second is RMC's check to ensure the pointer operation is actually safe. This pattern (two checks for similar issues in safe Rust code) is common, and we'll see it again in the next section. Click to see explanation for exercise 2 Having run rmc --visualize and clicked on one of the failures to see a trace, there are three things to immediately notice: This trace is huge. The standard library Vec is involved, there's a lot going on. The top of the trace file contains some "trace navigation tips" that might be helpful in navigating the trace. There's a lot of generated code and it's really hard to just read the trace itself. To navigate this trace to find the information you need, we recommend searching for things you expect to be somewhere in the trace: Search the document for rmc::any or variable_of_interest = such as size =. We can use this to find out what example values lead to a problem. In this case, where we just have a couple of rmc::any values in our proof harness, we can learn a lot just by seeing what these are. In this trace we find (and the values you get may be different): Step 23: Function main, File tests/bounds-check.rs, Line 43
let size: usize = rmc::any();
size = 0ul Step 27: Function main, File tests/bounds-check.rs, Line 45
let index: usize = rmc::any();
index = 0ul Step 36: Function main, File tests/bounds-check.rs, Line 43
let size: usize = rmc::any();
size = 2464ul Step 39: Function main, File tests/bounds-check.rs, Line 45
let index: usize = rmc::any();
index = 2463ul Try not to be fooled by the first assignments: we're seeing zero-initialization there. They get overridden by the later assignments. You may see different values here, as it depends on the solver's behavior. Try searching for "failure:". This will be near the end of the document. Now you can try reverse-searching for assignments to the variables involved. For example, search upwards from the failure for i =. These two techniques should help you find both the nondeterministic inputs, and see what values were involved in the failing assertion.

